import React, { Component } from 'react';

import styles from  './home.module.css';
import {typeText} from './typeText';


class Home extends Component {
    render() {
        return (
            <div className ={styles.pageWrapper}>
                <typeText />
                <h1>HOME PAGE</h1>
                {/* <div className={styles.pageBackground}>
                </div> */}
            </div>
        );
    }
}

export default Home;
